geModule -->\n\nPercentformaterPipe->CryptoviewPageModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/pages/General/cryptoview/cryptoview.module.ts\n        \n\n\n\n\n\n        \n            \n                \n                    Declarations\n                    \n                        \n                            CryptoviewPage\n                        \n                    \n                \n                \n                    Imports\n                    \n                        \n                            BackgraphbuttonDirective\n                        \n                        \n                            ColorpercentDirective\n                        \n                        \n                            CryptoviewPageRoutingModule\n                        \n                        \n                            CurrencyPipe\n                        \n                        \n                            PercentformaterPipe\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        import { NgModule } from '@angular/core';\nimport { CommonModule, PercentPipe } from '@angular/common';\nimport { FormsModule } from '@angular/forms';\n\nimport { IonicModule } from '@ionic/angular';\n\nimport { CryptoviewPageRoutingModule } from './cryptoview-routing.module';\n\nimport { CryptoviewPage } from './cryptoview.page';\nimport { TranslateModule } from '@ngx-translate/core';\nimport { CurrencyPipe } from 'src/app/core/pipes/currency.pipe';\nimport { ButtonModule } from 'primeng/button';\nimport { ColorpercentDirective } from 'src/app/core/directives/colorpercent.directive';\nimport { PercentformaterPipe } from 'src/app/core/pipes/percentformater.pipe';\nimport { BackgraphbuttonDirective } from 'src/app/core/directives/backgraphbutton.directive';\n\n@NgModule({\n  imports: [\n    CommonModule,\n    FormsModule,\n    IonicModule,\n    CryptoviewPageRoutingModule,\n    TranslateModule.forChild(),\n    CurrencyPipe,\n    PercentPipe,\n    PercentformaterPipe,\n    ColorpercentDirective,\n    BackgraphbuttonDirective\n],\n  declarations: [CryptoviewPage],\n})\nexport class CryptoviewPageModule {}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/CryptoviewPageRoutingModule.html":{"url":"modules/CryptoviewPageRoutingModule.html","title":"module - CryptoviewPageRoutingModule","body":"\n                   \n\n\n\n\n    Modules\n    CryptoviewPageRoutingModule\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/pages/General/cryptoview/cryptoview-routing.module.ts\n        \n\n\n\n\n\n        \n            \n            \n        \n\n\n    \n\n\n    \n        import { NgModule } from '@angular/core';\nimport { Routes, RouterModule } from '@angular/router';\n\nimport { CryptoviewPage } from './cryptoview.page';\n\nconst routes: Routes = [\n  {\n    path: '',\n    component: CryptoviewPage\n  }\n];\n\n@NgModule({\n  imports: [RouterModule.forChild(routes)],\n  exports: [RouterModule],\n})\nexport class CryptoviewPageRoutingModule {}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"pipes/CurrencyPipe.html":{"url":"pipes/CurrencyPipe.html","title":"pipe - CurrencyPipe","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n  Pipes\n  CurrencyPipe\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/core/pipes/currency.pipe.ts\n        \n\n\n            \n                Description\n            \n            \n                Pipe that transforms a currency code string into its corresponding currency symbol.\nSupported codes:\n\n\"gbp\"  \"\"\n\"eur\"  \"\"\nAny other value defaults to \"$\"\n\n\n            \n\n\n        \n            Metadata\n            \n                \n                    \n                        Name\n                        currencypipe\n                    \n                    \n                        Standalone\n                        true\n                    \n                \n            \n        \n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        transform\n                        \n                    \n                \n            \n            \n                \ntransform(value: string)\n                \n            \n\n\n                    \n                        \n                            Defined in src/app/core/pipes/currency.pipe.ts:23\n                        \n                    \n\n\n            \n                \n                        Transforms a currency code string into the corresponding symbol.\n\n\n                            \n                                Parameters :\n                                \n                                \n                                    \n                                        \n                                            Name\n                                                Type\n                                            Optional\n                                                Description\n                                        \n                                    \n                                    \n                                        \n                                                value\n                                            \n                                                            string\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                            \n                                                    Currency code string (e.g., \"gbp\", \"eur\").\n\n                                            \n                                        \n                                    \n                                \n                            \n                        \n                            Returns :         string\n\n                        \n                            \n                                The currency symbol as a string.\n\n                            \n                \n            \n        \n    \n\n\n    \n\n\n    \n        import { Pipe, PipeTransform } from '@angular/core';\n\n/**\n * Pipe that transforms a currency code string into its corresponding currency symbol.\n * \n * Supported codes:\n * - \"gbp\"  \"\"\n * - \"eur\"  \"\"\n * - Any other value defaults to \"$\"\n */\n@Pipe({\n  name: 'currencypipe',\n  standalone: true\n})\nexport class CurrencyPipe implements PipeTransform {\n\n  /**\n   * Transforms a currency code string into the corresponding symbol.\n   * \n   * @param value Currency code string (e.g., \"gbp\", \"eur\").\n   * @returns The currency symbol as a string.\n   */\n  transform(value: string): string {\n    if (value === \"gbp\") {\n      return \"\";\n    } else if (value === \"eur\") {\n      return \"\";\n    } else {\n      return \"$\";\n    }\n  }\n}\n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/CustomGenderComponent.html":{"url":"components/CustomGenderComponent.html","title":"component - CustomGenderComponent","body":"\n                   \n\n\n\n\n\n  Comp